import React from "react"
import { Navigation } from "swiper";
import { Swiper } from "swiper/react";

import 'swiper/scss';
import 'swiper/scss/navigation';

import PickCarouselItem from "./PickCarouselItem";

const PickCarousel = () => {
  // const imgWidth = [
  //   "200x",
  //   "300x",
  //   "400x",
  //   "600x",
  //   "800x",
  // ];
  const item = [];

  for (let i = 1; i <= 8; i++) {
    item.push(<PickCarouselItem image={`Pick_${i}_1_800x`} />);
  }

  return (
    <Swiper
      spaceBetween={20}
      slidesPerView={4}
      slidesPerGroup={4}
      modules={[Navigation]}
      grabCursor={true}
      navigation
    >
      {item}
    </Swiper>
  )
}

export default PickCarousel
